import React from 'react';
// import logo from './logo.svg';
import './App.css';
import MainContainer from './containers/MainContainer'

function App() {
  return (
    <div className="App stars">
      <div className='twinkling'>
        <div className='clouds'>
            <MainContainer />
          <header className="App-header">
          </header>
      </div>
      </div>
    </div>
  );
}

export default App;
